import React from "react";
import { Navbar } from "react-bootstrap";
import "../css/myStyles.css";
export default function HeaderBar() {

  return (
    <Navbar
      fixed="top"
      expand="lg"
      bg="dark"
      variant="dark"
      className="topnav"
    >
      <Navbar.Brand href="">Q&V Car Care</Navbar.Brand>
    </Navbar>
  );
}
